and safety of our communities and loved ones. So instead of large gatherings, we break bread and worship with loved ones in our homes. WE are the church and we will continue to worship. These circumstance will pass.\n\nWe live in a world lost. A world looking for answers. A world full of fear and anxiety. Afraid of being unloved. Afraid of uncertainty. Scared to be vulnerable. And afraid of death. But these are irrational fears that Satan uses to create doubt and anxiety. Enslaved by this fear of death, we continue to pursue immortality. Medicine, exercise, and nutrition have lengthened life expectancy by decades, but we desire more. Something our earthly bodies are not meant to endure. Death is inevitable.\n\nJames 4: 14 - Why, you do not even know what will happen tomorrow. What is your life? You are a mist that appears for a little while and then vanishes.\n\nJesus came to show us how to live, to love, showed us forgiveness, grace, and mercy. He came to pay the ultimate price for our sins, and offered a way for us b to be with God, and to worship with the angels for eternity.\n\nHe has given us the ability to embrace the riches of His victory over death. But we must die to our selfish desires and live for Christ. Romans 6: 14 says, \u201cFor sin shall no longer be your master, because you are not under the law, but under grace.\u201d And Hebrews 2: 14-15, \u201cSince the children have flesh and blood, he too shared in their humanity so that by his death he might break the power of him who holds the power of death\u2014that is, the devil\u2014 and free those who all their lives were held in slavery by their fear of death.\u201d - We no longer need to fear death, but rejoice in fact that Jesus has defeated death and we can spend eternity with Him in praise and worship!\n\nForever Growing ~ Forever Improving ~ Forever Dependent on Christ\n\n#UriahSteffen #Church #HomeChurch #GatherInLove #Worship #Adapt #PCC #PlainfieldChristianChurch #HomeGroups #KingdomLiving #WeAreTheChurch #ChristIsKing #SundayWorship #Love #BrethrenOfTheFeast"}}]},"shortcode":"B9xCWWxpEjl","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584300876,"dimensions":{"height":810,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/89797453_204721723949758_2640893944095087255_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=YoQ7aQ6Ro20AX-tml_z\u0026oh=b7af5b81e49ac0bde6db185053db4014\u0026oe=5EA28632","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"3661497250"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/c180.0.1080.1080a/s640x640/89797453_204721723949758_2640893944095087255_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=YoQ7aQ6Ro20AX-tml_z\u0026oh=cae45a2462f5181e48b6c33e401b769d\u0026oe=5E9AF273","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c180.0.1080.1080a/s150x150/89797453_204721723949758_2640893944095087255_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=YoQ7aQ6Ro20AX-tml_z\u0026oh=6ce9b52d1a15cd68d0dde3bc3bad0a57\u0026oe=5EA4F2B8","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c180.0.1080.1080a/s240x240/89797453_204721723949758_2640893944095087255_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=YoQ7aQ6Ro20AX-tml_z\u0026oh=f66255ed49beb840e577f27ef4edc89f\u0026oe=5EA67EF2","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c180.0.1080.1080a/s320x320/89797453_204721723949758_2640893944095087255_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=110\u0026_nc_ohc=YoQ7aQ6Ro20AX-tml_z\u0026oh=339d4c1ebb70e46aecefad8d24b1b8e3\u0026oe=5E9C7348","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/c180.0.1080. aphSidecar","id":"2265602411750605089","edge_media_to_caption":{"edges":[{"node":{"text":"Hey :) ~\n~\nHeute war ich wieder mit Chevi ausreiten\ud83d\ude48 Diese Woche hatte ich Urlaub und wir waren jeden Tag im Gel\u00e4nde \ud83d\ude48 Vorgestern bin ich mit einer Freundin durchs Dorf geritten und nat\u00fcrlich mit dem Chevi seinen Kumpel \ud83d\ude48 Das machen die beiden echt super!\u2665\ufe0f ~\n~\nChevi hat total Spa\u00df im Gel\u00e4nde zu laufen, aber er freut sich auch wenn er wieder bei seinen anderen Kumpels ist \u2665\ufe0f\ud83d\ude48\n~\n~\nHeute stand Chevi mal wieder mit Cabbalero drau\u00dfen. Cabbalero hat sich unterworfen (mit Kauen) und Chevi quietschte immer wieder um die Rangordnung zu kl\u00e4ren. \ud83d\ude05Irgendwann war alles gekl\u00e4rt und dann legte sich der Cabbalero neben den Chevi hin und w\u00e4lzte sich erstmal im Heu \u2665\ufe0f\ud83d\ude05\n~\n~\nDas war heute sooo s\u00fc\u00df, wischt mal r\u00fcber um das Bild zu sehen \ud83d\ude48 Er streckt die Zunge auf dem Bild raus. Ich konnte mich zu ihm hinsetzen, das hat mich so sehr gefreut \u2665\ufe0f\ud83d\ude48Cabbalero war total faul und wollte nicht aufstehen \u2665\ufe0f\ud83d\ude48\n~\n~\nHaaach ich lieb die zwei \u2665\ufe0f\ud83d\ude48\ud83d\udc34\ud83d\udc34\n~\n~\nIch muss mal wieder ein paar Bilder mit den Pferden machen\u2665\ufe0f\ud83d\ude48\n~\n~\nDem Cabbalero geht es \u00fcbrigens wieder gut, er hat die Kastration gut \u00fcberstanden und alles ist gut abgeheilt \ud83d\ude48 ~\n~\nWir w\u00fcnschen euch noch einen sch\u00f6nen Sonntag \u2665\ufe0f\n~\n~\nLiebe Gr\u00fc\u00dfe ~\n~\nLordChevalier,Cabbalero\u0026Celine\u2665\ufe0f\ud83d\udc34\ud83d\udc34\n~\n~\n#myhorses #bayerischeswarmblut #wallach #kurgest\u00fcthoherodenwald #kurgest\u00fctler #gel\u00e4ndereiten #dressage #horsesofinstagram #horselove #j\u00e4hrling #jungpferdeausbildung #love #lovemyhorses"}}]},"shortcode":"B9xCWPKqcEh","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584300875,"di de papa/ \ud83d\udd3c1 cucharada de aceite (podes usar cualquier aceite, nosotras preferimos el aceite de oliva)/ \ud83d\udd3cSal a gusto\n.\n- Para el relleno:\n\ud83d\udd3c50 gr de soja texturizada (crudo)/ \ud83d\udd3c1/2 cebolla/ \ud83d\udd3c1 ajo/ \ud83d\udd3c1 tomate/ \ud83d\udd3c1/4 de morr\u00f3n/ \ud83d\udd3cCondimentos: or\u00e9gano, comino, sal, etc./ \ud83d\udd3c1 cucharada de aceite\n.\n\ud83d\udc69\u200d\ud83c\udf73\ud83d\udc68\u200d\ud83c\udf73Preparaci\u00f3n \ud83d\udc68\u200d\ud83c\udf73\ud83d\udc69\u200d\ud83c\udf73\n- Para el pur\u00e9: Hervir la papa ya pelada y cortada, con agua y agregar un poco de sal. Una vez cocida, hacerlas pur\u00e9 y agregar el aceite.\n- Para el relleno: Picar la cebolla, el ajo en cuadraditos y ponerlos a cocinar en una olla; agregar los condimentos y la sal. Remover con un cucharon (de madera  o de pl\u00e1stico) todo el tiempo, hasta que se cocine la cebolla. No es necesario agregar el aceite, con un chorro de agua es suficiente. Luego, agregar a esta cocci\u00f3n, el tomate y morr\u00f3n, cortados previamente en cuadraditos. Una vez cocidos, agregar la soja texturizada (antes hay que ponerla a remojar en agua caliente). Enaceitar unas bandejas. Dar forma de nidito al pur\u00e9 y agregar al centro el relleno. Ponerlas en un horno precalentado y dejarlas hasta que se doren.\n.\nY listo! Los niditos ya estan listos para comer!!!! \ud83d\ude0b\n.\n..\n.\n#vegan #habitos #veganfood #vegetarian #vegetariano #almuerzo #organic #glutenfree #govegan #food #healthy #vegansofig #saludable #foodie #veganlife #love #whatveganseat #healthylifestyle #veganism #vegano #fitness #veganfoodshare #alimento #health #instafood #bajarpeso #natural #vegansofinstagram #vegetal #nutricion"}}]},"shortcode":"B9wuvrlHByq","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584290598,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89864850_797115050776597_14884552420466470
